import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LoginPage from "./LoginPage";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginPage />} />
        <Route path="/app" element={<h1>Welcome to the App!</h1>} />
        <Route path="/about" element={<h1>About Page</h1>} />
        <Route path="/gallery" element={<h1>Gallery Page</h1>} />
        <Route path="/resources" element={<h1>Resources Page</h1>} />
        <Route path="/policies" element={<h1>Policies Page</h1>} />
        <Route path="/forgot-password" element={<h1>Forgot Password</h1>} />
        <Route path="/signup" element={<h1>Sign Up</h1>} />
        <Route path="/join" element={<h1>Join Us</h1>} />
      </Routes>
    </Router>
  );
}

export default App;
